// ProfileScreen.js
import React, { useEffect } from 'react';
import { View, Text } from 'react-native';
import { fetchData } from '../../data/TheMealDB';

const Profile = () => {
    useEffect(async () => {
        try {
            const data = await fetchData("search.php?s=");
            console.log(data);
        } catch (error) {
            console.log(error);
        }

    }, []);
    return (
        <View>
            <Text>Ini adalah layar profil!</Text>
            {/* Tambahkan komponen atau logika lain yang diperlukan */}
        </View>
    );
};

export default Profile;
